require 'spec_helper'

describe OpenAssets::Protocol::MarkerOutput do

  it 'to payload' do
    payload = OpenAssets::Protocol::MarkerOutput.new([10000], 'u=https://cpr.sm/5YgSU1Pg-q').to_payload
    expect(payload).to eq('4f41010001904e1b753d68747470733a2f2f6370722e736d2f35596753553150672d71')

    no_metadata_payload = OpenAssets::Protocol::MarkerOutput.new([10000], nil).to_payload
    expect(no_metadata_payload).to eq('4f41010001904e00')

    binary_metadata_payload = OpenAssets::Protocol::MarkerOutput.new([10000], "\x00\x01\x02\x03\x04\x05\x06\x07\x08\x09\x0a\x0b\x0c\x0d\x0e\x0f").to_payload
    expect(binary_metadata_payload).to eq('4f41010001904e10000102030405060708090a0b0c0d0e0f')

    asset_quantities = []
    252.times {asset_quantities << 4}
    payload_252 = OpenAssets::Protocol::MarkerOutput.new(asset_quantities, '').to_payload
    expect(payload_252).to eq('')

    asset_quantities = []
    253.times {asset_quantities << 4}
    payload_253 = OpenAssets::Protocol::MarkerOutput.new(asset_quantities, '').to_payload
    expect(payload_253).to eq('')

    asset_quantities = []
    10000.times {asset_quantities << 4}
    payload_10000 = OpenAssets::Protocol::MarkerOutput.new(asset_quantities, '').to_payload
    expect(payload_10000).to eq('')

    asset_quantities = []
    65535.times {asset_quantities << 4}
    payload_65535 = OpenAssets::Protocol::MarkerOutput.new(asset_quantities, '').to_payload
    expect(payload_65535).to eq('')

    asset_quantities = []
    65536.times {asset_quantities << 4}
    payload_65536 = OpenAssets::Protocol::MarkerOutput.new(asset_quantities, '').to_payload
    expect(payload_65536).to eq('')
  end

  it 'deserialize payload' do
    marker_output = OpenAssets::Protocol::MarkerOutput.
        deserialize_payload('4f41010001904e1b753d68747470733a2f2f6370722e736d2f35596753553150672d71')
    expect(marker_output.asset_quantities.length).to eq(1)
    expect(marker_output.asset_quantities[0]).to eq(10000)
    expect(marker_output.metadata).to eq('u=https://cpr.sm/5YgSU1Pg-q')
  end

  describe 'parse_script' do
    context 'valid script' do
      subject{
        # OP_RETURN 4f41010002014400 (colored coin marker output)
        OpenAssets::Protocol::MarkerOutput.parse_script(Bitcoin::Script.new(['6a084f41010002014400'].pack("H*")).to_payload)
      }
      it do
        expect(subject).to eq('4f41010002014400')
      end
    end

    context 'not start oap marker' do
      subject{
        # OP_RETURN deadbeef (normal bitcoin op_return)
        OpenAssets::Protocol::MarkerOutput.parse_script(Bitcoin::Script.new(['6a04deadbeef'].pack("H*")).to_payload)
      }
      it do
        expect(subject).to be_nil
      end
    end

    context 'invalid varint' do
      it do
        expect(OpenAssets::Protocol::MarkerOutput.parse_script(Bitcoin::Script.new(['6a224f41010001ee05753d68747470733a2f2f6370722e736d2f6d694c5a50484779782d'].pack("H*")).to_payload)).to be_nil
        expect(OpenAssets::Protocol::MarkerOutput.parse_script(Bitcoin::Script.new(['6a094f41010002ac02c21c'].pack('H*')).to_payload)).to be_nil
      end
    end
  end

  it 'build script' do
    script = OpenAssets::Protocol::MarkerOutput.new([10000], 'u=https://cpr.sm/5YgSU1Pg-q').build_script
    expect(script.to_string).to eq('OP_RETURN 4f41010001904e1b753d68747470733a2f2f6370722e736d2f35596753553150672d71')
  end

end
